// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";

contract MFL is ERC721 {
	mapping(uint => uint) private prices;
	constructor() ERC721("MFL", "MFL") {
		// ETC
		prices[2] = 0.01 ether;
		prices[3] = 0.02 ether;
		prices[4] = 0.03 ether;

		// LTC
		prices[5] = 0.04 ether;
		prices[6] = 0.05 ether;
		prices[7] = 0.06 ether;

		// BTC
		prices[8] = 0.07 ether;
		prices[9] = 0.08 ether;
		prices[10] = 0.09 ether;
	}

	uint private lastToken = 1000000;
	uint private basePrice = 10000000000000000;

	mapping(uint => uint) private status;
	mapping(address => uint[]) private myLands;
	mapping(address => mapping(uint => uint)) private ownershipIndex;
	mapping(address => uint[]) private myLandStatuses;
	mapping(address => mapping(uint => uint)) private ownerLandStatusIndex;

	function getMyLands(address addr) public view returns (uint[] memory) {
		return myLands[addr];
	}
	function getMyLandStatuses(address addr) public view returns (uint[] memory) {
		return myLandStatuses[addr];
	}

	function mintLand(uint tokenId) payable external {
		require(msg.value == basePrice, "Invalid Amount");
		require(tokenId < lastToken, "Invalid Token Id");

		_mint(msg.sender, tokenId);

		status[tokenId] = 1;
		myLandStatuses[msg.sender].push(1);
		ownerLandStatusIndex[msg.sender][tokenId] = myLandStatuses[msg.sender].length;

		myLands[msg.sender].push(tokenId);
		ownershipIndex[msg.sender][tokenId] = myLands[msg.sender].length;
	}
	function _beforeTokenTransfer(address from, address to, uint256 tokenId) internal virtual override {
		if (status[tokenId] > 0) {
			// Delete current owner record
			delete myLands[from][ownershipIndex[from][tokenId] - 1];
			delete ownershipIndex[from][tokenId];

			delete myLandStatuses[from][ownerLandStatusIndex[from][tokenId] - 1];
			delete ownerLandStatusIndex[from][tokenId];

			// Set new owner record
			myLands[to].push(tokenId);
			ownershipIndex[to][tokenId] = myLands[to].length;

			myLandStatuses[to].push(status[tokenId]);
			ownerLandStatusIndex[to][tokenId] = myLandStatuses[to].length;
		}
	}

	function updateStatus(uint tokenId, uint newStatus) payable external {
		require(newStatus >= 2);
		require(newStatus <= 10);
		require(msg.value == prices[newStatus]);
		require(ownerOf(tokenId) == msg.sender);

		status[tokenId] = newStatus;
		myLandStatuses[msg.sender][ownerLandStatusIndex[msg.sender][tokenId] - 1] = newStatus;
	}

	function getStatus(uint start, uint end) public view returns (uint[] memory) {
		require(end > start);
		require(end <= lastToken);

		uint[] memory arr = new uint[](end - start + 1);
		uint counter = 0;
		for (uint i = start; i <= end; i++) {
			arr[counter] = status[i];
			counter++;
		}

		return arr;
	}
}
